var data = [[], [], [], [], [], [], [], [], [], [], [], [], [], [], [], [], [], []];

var year = 0;

//data[0] -> 2017
//data[1] -> 2018
//data[2] -> 2019

var downloadProgress = document.getElementById("downloadProgress");

var type = ["SO2", "NO2", "O3", "CO", "PM10", "PM2.5"];


var tagCheckboxes = document.querySelectorAll(".tagCheckBox");
tagCheckboxes.forEach(function (tagCheckbox) {
  tagCheckbox.addEventListener("click", tagCheckboxClicked);
});

function tagCheckboxClicked(event) {
  tagCheckboxes.forEach(function (checkbox) {
    checkbox.checked = false;
  });

  var thisCheckbox = event.target;
  var name = thisCheckbox.getAttribute("name");
  if (name == "2017") {
    thisCheckbox.checked = true;
    year = 0;
  }
  else if (name == "2018") {
    thisCheckbox.checked = true;
    year = 6;
  }
  else if (name == "2019") {
    thisCheckbox.checked = true;
    year = 12;
  }
  updatePlot();
}
console.log(123);


function loadCSVWithProgress(url) {
  return new Promise((resolve, reject) => {
    var xhr = new XMLHttpRequest();
    xhr.open("GET", url, true);
    xhr.responseType = "text";

    xhr.onprogress = function (event) {
      if (event.lengthComputable) {
        var percentComplete = (event.loaded / event.total) * 100;
        downloadProgress.innerHTML = "csv download progress: " + percentComplete.toFixed(2) + "%";
      }
    };

    xhr.onload = function () {
      if (xhr.status === 200) {
        var csvData = d3.csvParse(xhr.responseText);
        resolve(csvData);
      } else {
        reject(new Error("Can't download CSV"));
      }
    };

    xhr.send();
  });
}

loadCSVWithProgress("air-pollution.csv")
  .then(function (csvData) {
    var dateData = {};

    console.log(456);
    downloadProgress.remove();


    csvData.forEach(function (d) {
      var location = d["Address"];
      var date = d["Measurement date"].split(" ")[0];
      for (var i = 0; i < type.length; i++) {
        var key = location + "_" + date + "_" + type[i];
        if (key in dateData) {
          if (+d[type[i]] > 0) {
            dateData[key]["value"] += +d[type[i]];
            dateData[key]["count"] += 1;
          }
        }
        else {
          if (+d[type[i]] > 0) {
            var item = { "date": date, "value": +d[type[i]], "count": 1 };
            dateData[key] = item;
          }
          else {
            var item = { "date": date, "value": 0, "count": 0 };
            dateData[key] = item;
          }

        }
      }

    });

    Object.keys(dateData).forEach(function (key) {
      var year = dateData[key]["date"].split("-")[0];
      if (year == "2017") {
        if (dateData[key]["count"] > 0) {
          dateData[key]["value"] /= dateData[key]["count"];
        }
        else {
          dateData[key]["value"] = 0;
        }
        dateData[key]["series"] = key.split('_')[0];
        dateData[key]["ts"] = new Date(dateData[key]["date"]);
        dateData[key]["val"] = dateData[key]["value"];

        delete dateData[key]["count"];
        delete dateData[key]["name"];
        delete dateData[key]["value"];
        delete dateData[key]["date"];

        var index = 0;
        index += type.indexOf(key.split('_')[2]);

        data[index].push(dateData[key]);
      }
      else if (year == "2018") {
        if (dateData[key]["count"] > 0) {
          dateData[key]["value"] /= dateData[key]["count"];
        }
        else {
          dateData[key]["value"] = 0;
        }
        dateData[key]["series"] = key.split('_')[0];
        dateData[key]["ts"] = new Date(dateData[key]["date"]);
        dateData[key]["val"] = dateData[key]["value"];

        delete dateData[key]["count"];
        delete dateData[key]["name"];
        delete dateData[key]["value"];
        delete dateData[key]["date"];

        var index = 6;
        index += type.indexOf(key.split('_')[2]);

        data[index].push(dateData[key]);
      }
      else {
        if (dateData[key]["count"] > 0) {
          dateData[key]["value"] /= dateData[key]["count"];
        }
        else {
          dateData[key]["value"] = 0;
        }

        dateData[key]["series"] = key.split('_')[0];
        dateData[key]["ts"] = new Date(dateData[key]["date"]);
        dateData[key]["val"] = dateData[key]["value"];

        delete dateData[key]["count"];
        delete dateData[key]["name"];
        delete dateData[key]["value"];
        delete dateData[key]["date"];

        var index = 12;
        index += type.indexOf(key.split('_')[2]);

        data[index].push(dateData[key]);
      }
    })



    updatePlot()
  })
  .catch(function (error) {
    console.error("Error: " + error.message);
  });





